import { useParams } from "react-router-dom";
import { useEffect, useState } from "react";

export default function HostCarPricing() {
    const { id } = useParams()
    const [car, setCar] = useState(0);
    useEffect(() => {
        const res = JSON.parse(localStorage.getItem("cars"));
        const data = res.filter(c => c.id === id && c.hostId === "1");
        setCar(data[0]);
    }, []);
    return (
        <h1>${ car.price }/day</h1>
    );
};
